import { FETCH_POSTS, NEW_POST } from "../actions/types";

const initialState = {
  carrierCode: ""
  //   item: {}
};

export default function(state = initialState, action) {
  switch (action.type) {
    case FETCH_POSTS:
      return {
        ...state,
        carrierCodes: action.payload
      };
    // case NEW_POST:
    //   return {
    //     ...state,
    //     item: action.payload
    //   };
    default:
      return state;
  }
}
